INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `asal_kuliner`, `foto_kuliner`, `deskripsi_kuliner`) VALUES
(15, 'Rendang', 'Sumatera Barat', , 'Rendang (bahasa Minangkabau: randang) (Jawi: ) adalah hidangan berbahan dasar daging yang dihasilkan dari proses memasak suhu rendah dalam waktu lama dengan menggunakan aneka rempah-rempah dan santan. Proses memasaknya memakan waktu berjam-jam (biasanya sekitar empat jam) hingga yang tinggal hanyalah potongan daging berwarna hitam pekat dan dedak. Dalam suhu ruangan, rendang dapat bertahan hingga berminggu-minggu. Rendang yang dimasak dalam waktu yang lebih singkat dan santannya belum mengering disebut kalio, berwarna cokelat terang keemasan.\n\nRendang dapat dijumpai di Rumah Makan Padang di seluruh dunia. Masakan ini populer di Indonesia dan negara-negara Asia Tenggara lainnya, seperti Malaysia, Singapura, Brunei, Filipina, dan Thailand. Di daerah asalnya, Minangkabau, rendang disajikan di berbagai upacara adat dan perhelatan istimewa. Meskipun rendang merupakan masakan tradisional Minangkabau, teknik memasak serta pilihan dan penggunaan bumbu rendang berbeda-beda menurut daerah.\n\nPada 2011, rendang pernah dinobatkan sebagai hidangan yang menduduki peringkat pertama daftar World\'s 50 Most Delicious Foods (50 Hidangan Terlezat Dunia) versi CNN International. Pada 2018, rendang secara resmi ditetapkan sebagai salah satu dari lima hidangan nasional Indonesia.\n\nRendang dimanfaatkan sebagai bantuan pangan bagi korban bencana alam karena tahan lama dan kandungan gizinya, seperti pada gempa bumi Lombok 2018, gempa bumi dan tsunami Sulawesi 2018, banjir Bengkulu 2019, badai Siklon Seroja 2021, dan gempa bumi Cianjur 2022.\n\nBumbu rendang diolah secara fusion (mencampur) dengan makanan lain seperti spageti, mi, burger, hingga susyi.');
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `asal_kuliner`, `foto_kuliner`, `deskripsi_kuliner`) VALUES
(16, 'Pempek', 'Sumatera Selatan', , 'Pempek adalah makanan yang terbuat dari daging ikan yang digiling lembut yang dicampur tepung kanji atau tepung sagu, serta komposisi beberapa bahan lain seperti telur, bawang putih yang dihaluskan, penyedap rasa, dan garam. Pempek biasanya disajikan dengan kuah yang disebut cuka yang memiliki rasa asam, manis, dan pedas. Pempek merupakan makanan khas Palembang - Sumatera Selatan.\n\n\nPada tahun 1880-an, penjual biasa memikul satu keranjang penuh pempek sambil berjalan kaki berkeliling menjajakan dagangannya.\n\nDi kota nya pempek , palembang. cara makan pempek yang benar adalah dengan mengunakan mangkuk kecil sebagai tempat cukonya lalu di makan pempeknya setelah itu pempek dicocol dan cukonya diseruput untuk menambah rasanya nikmatnya.');
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `asal_kuliner`, `foto_kuliner`, `deskripsi_kuliner`) VALUES
(17, 'Soto Banjar', 'Kalimantan Selatan', , 'Soto Banjar adalah soto khas suku Banjar, Kalimantan Selatan dengan bahan utama daging ayam serta memiliki aroma harum rempah-rempah seperti kayu manis, biji pala, dan cengkih . Soto ini berisi daging ayam yang sudah disuwir-suwir, dengan tambahan perkedel, kentang rebus, rebusan telur, potongan wortel dan ketupat.\n\nSeperti halnya soto ayam, bumbu soto Banjar berupa bawang merah, bawang putih dan merica, tetapi tidak memakai kunyit. Bumbu ditumis lebih dulu dengan sedikit minyak goreng atau minyak samin hingga harum sebelum dimasukkan ke dalam kuah rebusan ayam. Rempah-rempah nantinya diangkat agar tidak ikut masuk ke dalam mangkuk sewaktu dihidangkan.\n\nPenjual soto Banjar biasanyan juga menyajikan sate ayam sebagai menu pendamping. Nasi sop adalah sebutan untuk soto Banjar yang dikuahkan ke sepiring nasi.');
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `asal_kuliner`, `foto_kuliner`, `deskripsi_kuliner`) VALUES
(18, 'Gulai Ikan Patin ', 'Jambi', , 'Gulai Ikan Patin adalah masakan yang diolah menggunakan tempoyak yaitu daging buah yang telah di fermentasi,  namun dapat digantikan juga dengan santan untuk menghindari bau dan rasa tempoyaknya yang cukup menyengat. Rasa gulai patin didominasi dengan rasa asam gurih, dapat kita temukan dimana saja di daerah Jambi , karena menjadi menu utama yang paling dicari. Harganya pun terjangkau karena dibuat oleh warga asli Jambi.');
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `asal_kuliner`, `foto_kuliner`, `deskripsi_kuliner`) VALUES
(19, 'Kerak Telur', 'Jakarta', , 'Kerak telur adalah makanan asli daerah Jakarta (Betawi), dengan bahan-bahan beras ketan putih, telur ayam atau bebek, ebi (udang kering yang diasinkan) yang disangrai kering ditambah bawang merah goreng, lalu diberi bumbu yang dihaluskan berupa kelapa sangrai, cabai merah, kencur, jahe, merica butiran, garam dan gula pasir. Kerak telor dapat ditemukan pada hari biasa. Anda bisa menemukan kerak telor di sekitar Kota Tua, Jakarta Barat. Menurut sejarah, Kerak Telor sudah ada dari zaman kolonial Belanda, kerak telor diciptakan oleh masyarakat Betawi secara tak sengaja Pada tahun 1970-an.');

